window.bookSummaryJSON = "<p>An untamed witch. A forgotten past. An unknown legacy.</p> <p>The nightmares might have stopped, but it's just the beginning for Alice Skye.</p> <p>Newly Independent Paladin Agent Alice Skye is just starting to get her life together. She’s survived a cult, taken down a corrupt druid, and things are just starting to heat up with London’s finest bachelor, Riley Storm.<br> <br> With stolen Fae artefacts, missing hearts, and a tight-lipped detective, Alice must break down Peyton’s barriers, especially since his secret will help find the truth behind several gruesome murders. <br> <br> But the Council are still watching, waiting as they’re quietly deciding her fate.<br> Can she survive their judgment?<br> Or will it be her ancestry that destroys her?</p> <p><i>Elemental's Curse</i> is the fourth instalment in this nail-biting, action packed urban fantasy series by Taylor Aston White. Follow Alice as she battles her Daemons and unveils dark secrets in a modern world of magic.</p> <p>Disclaimer: This novel is written in British English including spelling and grammar.</p>"; 
